// Journal Section: Textbox entry
import React from "react";
// import React, { useState } from "react";
import { JournalContainer, JournalContent, JournalH1, JournalTextEntry, ButtonContainer, Button } from "./JournalElements"
import { ReactComponent as Next } from "../../images/NextArrow.svg";
import { ReactComponent as Back } from "../../images/BackArrow.svg";
import { Link, Redirect } from 'react-router-dom';

class JournalPage extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            journalEntry: '',
            redirectToIntention: false
        };
    }

    onChange(e) {
        this.setState({journalEntry: e.target.value});
    }

    // handleJournal = e => {
    //     e.preventDefault();
    //     fetch('http://127.0.0.1:5000/getJournal', {
    //         method: 'POST',
    //         mode: 'cors',
    //         headers: {
    //             'Content-Type': 'application/json'
    //           },
    //           body: JSON.stringify({
    //             journalEntry: this.state.journalEntry,
    //           })
    //     })
    // }
    handleFormSubmit = formSubmitEvent => {
        this.setState({
            redirectToIntention: true
        })
        // formSubmitEvent.preventDefault();

        // --------------------------------

        // console.log("making request")
        // fetch('http://127.0.0.1:5000/getJournal', {
        //     method:"POST",
        // })
        // .then(response => {
        //     console.log(response)
        //     return response.json()
        // })
        // .then(json => {
        // console.log=(json)
        // })

        // ---------------------------------
    };

    render() {
        const redirectToIntention = this.state.redirectToIntention;
        if (redirectToIntention) {
            return <Redirect to="/intention" />
        }
        // http://127.0.0.1:5000/getJournal
        return(
            <JournalContainer>
                <JournalContent>
                    <JournalH1>Feel free to express anything and everything on your mind right now.</JournalH1>
                    {/* //from inside form tag: onSubmit={this.handleFormSubmit} */}
                    <form method = "POST" action = "http://127.0.0.1:5000/getJournal">
                    <JournalTextEntry placeholder="Start your journal entry here" value={this.state.journalEntry} onChange={this.onChange.bind(this)}></JournalTextEntry>
                    <ButtonContainer>
                        <Link to="/mood" padding="0px 0px">
                        <Button>
                            <Back className="backButton" />
                        </Button>
                        </Link>
                        <Button type="submit">
                            <Next className="nextButton" />
                        </Button>
                        {/* <button onClick = {this.handleJournal}>Click me (Journal Entry)</button> */}
                    </ButtonContainer>
                    </form>
                </JournalContent>
            </JournalContainer>
        )
    }
}


export default JournalPage;
